import React from "react";
import { useSelector } from "react-redux";
import ProductCard from "../components/ProductCard";
import ProductsSideBar from "../components/ProductsSideBar";

const ProductsPage = () => {
  const productsFromStore = useSelector(
    (state) => state.products.products
  );

  return (
    <section className="mt-[70px] p-10 flex flex-row px-40 gap-5">
      <ProductsSideBar />
      <div className="flex flex-col gap-3">
        <div className="flex flex-row jus">
          <div class="relative">
            <div class="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none">
              <svg
                aria-hidden="true"
                class="w-5 h-5 text-gray-500 dark:text-gray-400"
                fill="none"
                stroke="currentColor"
                viewBox="0 0 24 24"
                xmlns="http://www.w3.org/2000/svg"
              >
                <path
                  stroke-linecap="round"
                  stroke-linejoin="round"
                  stroke-width="2"
                  d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z"
                ></path>
              </svg>
            </div>
            <input
              type="search"
              id="default-search"
              class="block w-full px-4 py-2 pl-10 text-sm text-gray-900 border border-gray-300 rounded-lg bg-gray-50 w-full"
              placeholder="Search by Name"
              required
            />
          </div>
        </div>
      </div>
    </section>
  );
};

export default ProductsPage;
